import {FaBars, FaTimes} from "react-icons/fa";

function Navbar() {
    return(
        <header>
            <h3>Movie Playlist</h3>
            <nav>
                <input 
                placeholder='Search your favorite film...'  
                className='movie-search'
                //onChange={({target}) => search(target.value)}
                />

                <button>
                    <FaTimes/>
                </button>
                <button>
                    <FaBars/>
                </button>
            </nav>
        </header>
    );
}

export default Navbar;
